function amazingSubArray(valueString) {
  let total = 0;
  for (let i = 0; i < valueString.length; i++) {
    let c = valueString.charAt(i);
    if (vowel(c)) {
      total += valueString.length - i;
    }
  }
  let res = BigInt(total % 1003);
  return res;
}

function vowel(c) {
  let str = c.toLowerCase();
  if (str == "a" || str == "e" || str == "i" || str == "o" || str == "u") {
    return true;
  }
  return false;
}

console.log(
  amazingSubArray(
    ""
  )
);
